import React, {useContext} from 'react'
import TodoEl from './TodoEl';
import { Context } from '../Store';

function AllTodos() {

  const [state, setState] = useContext(Context);

  return (
    <ul>
        {state.todos.map(item => <TodoEl key={item.id} {...item} />)}
    </ul>
  )
}

export default AllTodos;
